import React from "react";
import codeReviewWire from "../../../../public/assets/landing page/wire-code-review.png";
import mlSupWire from "../../../../public/assets/landing page/wire-mlsup.png";
import wirePlag from "../../../../public/assets/landing page/wire-plag.png";


const LPAssets = () => {
  return (
    <div className="absolute bottom-10 top-16 -translate-y-28 left-0 flex items-center gap-2">
      <img src={codeReviewWire} width={100} />
      <p className="-translate-y-[3.6em] text-[#5C837E]">Instant Code Review</p>
      <div className="translate-y-28 -translate-x-[21.5em] flex items-center gap-2">
        <img src={mlSupWire} width={100} />
        <p className=" text-[#5C837E]">Multilanguage Support</p>
      </div>
      <div className="translate-y-32 -translate-x-[21.5em] flex items-center gap-2">
        <img src={wirePlag} width={500} />
        <p className=" text-[#5C837E]">Multilanguage Support</p>
      </div>
    </div>
  );
};

export default LPAssets;
